      "<div id=\"mp-left\" class=\"MainPageBG mp-box\">\n",
      "<h2 id=\"mp-tfa-h2\" class=\"mp-h2\"><span id=\"From_today.27s_featured_article\"></span><span class=\"mw-headline\" id=\"From_today's_featured_article\">From today's featured article</span></h2>\n",
      "<div id=\"mp-tfa\" class=\"mp-contains-float\"><div id=\"mp-tfa-img\" style=\"float: left; margin: 0.5em 0.9em 0.4em 0em;\">\n",
      "<div class=\"thumbinner mp-thumb\" style=\"background: transparent; border: none; padding: 0; max-width: 171px;\">\n",
      "<a href=\"/wiki/File:Red_Warbler_-_Sinaloa_-_Mexico_S4E1238_(22444216014).jpg\" class=\"image\" title=\"Red warbler\"><img alt=\"Red warbler\" src=\"//upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Red_Warbler_-_Sinaloa_-_Mexico_S4E1238_%2822444216014%29.jpg/171px-Red_Warbler_-_Sinaloa_-_Mexico_S4E1238_%2822444216014%29.jpg\" decoding=\"async\" width=\"171\" height=\"114\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Red_Warbler_-_Sinaloa_-_Mexico_S4E1238_%2822444216014%29.jpg/257px-Red_Warbler_-_Sinaloa_-_Mexico_S4E1238_%2822444216014%29.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Red_Warbler_-_Sinaloa_-_Mexico_S4E1238_%2822444216014%29.jpg/342px-Red_Warbler_-_Sinaloa_-_Mexico_S4E1238_%2822444216014%29.jpg 2x\" data-file-width=\"1140\" data-file-height=\"760\" /></a></div>\n",
      "</div>\n",
      "<p>The <b><a href=\"/wiki/Red_warbler\" title=\"Red warbler\">red warbler</a></b> (<i>Cardellina rubra</i>) is a small bird of the <a href=\"/wiki/New_World_warbler\" title=\"New World warbler\">New World warbler</a> family, Parulidae. <a href=\"/wiki/Endemism\" title=\"Endemism\">Endemic</a> to the highlands of Mexico north of the <a href=\"/wiki/Isthmus_of_Tehuantepec\" title=\"Isthmus of Tehuantepec\">Isthmus of Tehuantepec</a>, it is closely related to the <a href=\"/wiki/Pink-headed_warbler\" title=\"Pink-headed warbler\">pink-headed warbler</a> of southern Mexico and Guatemala. There are three <a href=\"/wiki/Subspecies\" title=\"Subspecies\">subspecies</a>, which differ primarily in the shading of their ear patch and in the brightness and tone of their red body plumage. Young birds are pinkish-brown, with a whitish ear patch and two pale wingbars. Breeding typically occurs between February and May. The female lays three or four eggs in a domed nest, which she builds on the ground. Though she alone <a href=\"/wiki/Egg_incubation\" title=\"Egg incubation\">incubates</a> the eggs, both sexes feed the young and remove <a href=\"/wiki/Fecal_sac\" title=\"Fecal sac\">fecal sacs</a> from the nest. The young <a href=\"/wiki/Fledge\" title=\"Fledge\">fledge</a> within eleven days of hatching. The red warbler is an <a href=\"/wiki/Insectivore\" title=\"Insectivore\">insectivore</a>, <a href=\"/wiki/Gleaning_(birds)\" title=\"Gleaning (birds)\">gleaning</a> primarily in <a href=\"/wiki/Understory\" title=\"Understory\">understory</a> shrubs. The species is not <a href=\"/wiki/Threatened_species\" title=\"Threatened species\">threatened</a>, but its numbers are thought to be declining due to <a href=\"/wiki/Habitat_destruction\" title=\"Habitat destruction\">habitat destruction</a>. (<b><a href=\"/wiki/Red_warbler\" title=\"Red warbler\">Full&#160;article...</a></b>) \n",
      "</p>\n",
