      "<h2 id=\"mp-dyk-h2\" class=\"mp-h2\"><span class=\"mw-headline\" id=\"Did_you_know_...\">Did you know&#160;...</span></h2>\n",
      "<div id=\"mp-dyk\" class=\"mp-contains-float\">\n",
      "<div class=\"dyk-img\" style=\"float: right; margin-left: 0.5em;\">\n",
      "<div class=\"thumbinner mp-thumb\" style=\"background: transparent; border: none; padding: 0; max-width: 171px;\">\n",
      "<a href=\"/wiki/File:%EA%B3%A0%EC%B0%BD%EA%B0%AF%EB%B2%8C.jpg\" class=\"image\" title=\"Getbol, Korean Tidal Flats\"><img alt=\"Getbol, Korean Tidal Flats\" src=\"//upload.wikimedia.org/wikipedia/commons/thumb/2/2b/%EA%B3%A0%EC%B0%BD%EA%B0%AF%EB%B2%8C.jpg/171px-%EA%B3%A0%EC%B0%BD%EA%B0%AF%EB%B2%8C.jpg\" decoding=\"async\" width=\"171\" height=\"114\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/2/2b/%EA%B3%A0%EC%B0%BD%EA%B0%AF%EB%B2%8C.jpg/257px-%EA%B3%A0%EC%B0%BD%EA%B0%AF%EB%B2%8C.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/2/2b/%EA%B3%A0%EC%B0%BD%EA%B0%AF%EB%B2%8C.jpg/342px-%EA%B3%A0%EC%B0%BD%EA%B0%AF%EB%B2%8C.jpg 2x\" data-file-width=\"1800\" data-file-height=\"1200\" /></a><div class=\"thumbcaption\" style=\"padding: 0.25em 0; word-wrap: break-word;\">Getbol, Korean Tidal Flats</div></div>\n",
      "</div>\n",
      "<ul><li>... that <b><a href=\"/wiki/Getbol,_Korean_Tidal_Flats\" title=\"Getbol, Korean Tidal Flats\">Getbol, Korean Tidal Flats</a></b> <i>(pictured)</i>, a UNESCO World Heritage Site, is an important migration stopover for the critically endangered <a href=\"/wiki/Spoon-billed_sandpiper\" title=\"Spoon-billed sandpiper\">spoon-billed sandpiper</a>?</li>\n",
      "<li>... that <b><a href=\"/wiki/Eddie_Keenan\" title=\"Eddie Keenan\">Eddie Keenan</a></b> was once the largest American football player?</li>\n",
      "<li>... that physical applications of <b><a href=\"/wiki/Euclidean_minimum_spanning_tree\" title=\"Euclidean minimum spanning tree\">Euclidean minimum spanning trees</a></b> range in scale from the particles in <a href=\"/wiki/Bubble_chamber\" title=\"Bubble chamber\">bubble chambers</a> to the <a href=\"/wiki/Dark_matter_halo\" title=\"Dark matter halo\">dark matter halos</a> of galaxies?</li>\n",
      "<li>... that the <b><a href=\"/wiki/Court-martial_of_William_T._Colman\" title=\"Court-martial of William T. Colman\">court-martial of William T. Colman</a></b>, the commander of a U.S. air base, created a storm of protest when he was merely reduced in rank after shooting a black soldier?</li>\n",
      "<li>... that <a href=\"/wiki/Lemur\" title=\"Lemur\">lemur</a> health is threatened by <b><a href=\"/wiki/Climate_change_in_Madagascar\" title=\"Climate change in Madagascar\">climate change in Madagascar</a></b> due to the spread of parasites with warmer temperatures?</li>\n",
      "<li>... that the <b><a href=\"/wiki/KUGS\" title=\"KUGS\">radio station at Western Washington University</a></b> interfered with telephone and television services in a campus dormitory?</li>\n",
      "<li>... that Kannada-language author <b><a href=\"/wiki/M._V._Seetharamiah\" title=\"M. V. Seetharamiah\">M.&#160;V. Seetharamiah</a></b> established that the <a href=\"/wiki/Rashtrakuta_dynasty\" title=\"Rashtrakuta dynasty\">Rashtrakuta</a> emperor <a href=\"/wiki/Amoghavarsha\" title=\"Amoghavarsha\">Nrupatunga</a> did not write the classic <i><a href=\"/wiki/Kavirajamarga\" title=\"Kavirajamarga\">Kavirajamarga</a></i><span style=\"padding-left:0.15em;\">&#63;</span></li>\n",
      "<li>... that <a href=\"/wiki/Union_Carbide\" title=\"Union Carbide\">Union Carbide</a> bought <b><a href=\"/wiki/270_Park_Avenue_(1960%E2%80%932021)\" title=\"270 Park Avenue (19602021)\">270&#160;Park Avenue</a></b> in 1976 while moving out of the building?</li></ul>\n",
      "<div class=\"hlist hlist-separated dyk-footer noprint\" style=\"margin-top: 0.5em; text-align: right;\">\n",
