      "<div id=\"mp-itn\" class=\"mp-contains-float\"><style data-mw-deduplicate=\"TemplateStyles:r1053378754\">.mw-parser-output .itn-img{float:right;margin-left:0.5em;margin-top:0.2em}</style><div role=\"figure\" class=\"itn-img\">\n",
      "<div class=\"thumbinner mp-thumb\" style=\"background: transparent; border: none; padding: 0; max-width: 155px;\">\n",
      "<a href=\"/wiki/File:Uprising_in_Tehran,_Keshavarz_Boulvard_September_2022_(2,_cropped_for_ITN).jpg\" class=\"image\" title=\"Protesters in Tehran, Iran\"><img alt=\"Protesters in Tehran, Iran\" src=\"//upload.wikimedia.org/wikipedia/commons/thumb/1/18/Uprising_in_Tehran%2C_Keshavarz_Boulvard_September_2022_%282%2C_cropped_for_ITN%29.jpg/153px-Uprising_in_Tehran%2C_Keshavarz_Boulvard_September_2022_%282%2C_cropped_for_ITN%29.jpg\" decoding=\"async\" width=\"153\" height=\"128\" class=\"thumbborder\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/1/18/Uprising_in_Tehran%2C_Keshavarz_Boulvard_September_2022_%282%2C_cropped_for_ITN%29.jpg/230px-Uprising_in_Tehran%2C_Keshavarz_Boulvard_September_2022_%282%2C_cropped_for_ITN%29.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/1/18/Uprising_in_Tehran%2C_Keshavarz_Boulvard_September_2022_%282%2C_cropped_for_ITN%29.jpg/306px-Uprising_in_Tehran%2C_Keshavarz_Boulvard_September_2022_%282%2C_cropped_for_ITN%29.jpg 2x\" data-file-width=\"660\" data-file-height=\"550\" /></a><div class=\"thumbcaption\" style=\"padding: 0.25em 0; word-wrap: break-word; text-align: left;\">Protesters in <a href=\"/wiki/Tehran\" title=\"Tehran\">Tehran</a>, Iran</div></div>\n",
      "</div>\n",
      "<ul><li>Following the <b><a href=\"/wiki/Death_of_Mahsa_Amini\" title=\"Death of Mahsa Amini\">death of Mahsa Amini</a></b>, at least 50 people are killed during  <b><a href=\"/wiki/Mahsa_Amini_protests\" title=\"Mahsa Amini protests\">protests</a></b> <i>(example pictured)</i> in Iran.</li>\n",
      "<li>At least 100 people are killed in <b><a href=\"/wiki/2022_Kyrgyzstan%E2%80%93Tajikistan_clashes\" title=\"2022 KyrgyzstanTajikistan clashes\">renewed fighting</a></b> between Kyrgyzstan and Tajikistan.</li>\n",
      "<li>In <b><a href=\"/wiki/2022_Swedish_general_election\" title=\"2022 Swedish general election\">the Swedish general election</a></b>, the bloc consisting of the <a href=\"/wiki/Sweden_Democrats\" title=\"Sweden Democrats\">Sweden Democrats</a>, <a href=\"/wiki/Moderate_Party\" title=\"Moderate Party\">Moderates</a>, <a href=\"/wiki/Christian_Democrats_(Sweden)\" title=\"Christian Democrats (Sweden)\">Christian Democrats</a> and <a href=\"/wiki/Liberals_(Sweden)\" title=\"Liberals (Sweden)\">Liberals</a> wins a majority of seats in the <a href=\"/wiki/Riksdag\" title=\"Riksdag\">Riksdag</a>.</li>\n",
      "<li>French-Swiss filmmaker <b><a href=\"/wiki/Jean-Luc_Godard\" title=\"Jean-Luc Godard\">Jean-Luc Godard</a></b> dies at the <span class=\"nowrap\">age of 91</span>.</li></ul>\n",
      "<div class=\"itn-footer\" style=\"margin-top: 0.5em;\">\n",
