      "<h2 id=\"mp-otd-h2\" class=\"mp-h2\"><span class=\"mw-headline\" id=\"On_this_day\">On this day</span></h2>\n",
      "<div id=\"mp-otd\" class=\"mp-contains-float\">\n",
      "<p><b><a href=\"/wiki/September_25\" title=\"September 25\">September 25</a></b>\n",
      "</p>\n",
      "<div style=\"float:right;margin-left:0.5em;\" id=\"mp-otd-img\">\n",
      "<div class=\"thumbinner mp-thumb\" style=\"background: transparent; border: none; padding: 0; max-width: 140px;\">\n",
      "<a href=\"/wiki/File:Peking_Opera_1.JPG\" class=\"image\" title=\"Peking opera performer\"><img alt=\"Peking opera performer\" src=\"//upload.wikimedia.org/wikipedia/commons/thumb/6/6c/Peking_Opera_1.JPG/140px-Peking_Opera_1.JPG\" decoding=\"async\" width=\"140\" height=\"140\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/6/6c/Peking_Opera_1.JPG/210px-Peking_Opera_1.JPG 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/6/6c/Peking_Opera_1.JPG/280px-Peking_Opera_1.JPG 2x\" data-file-width=\"2668\" data-file-height=\"2668\" /></a><div class=\"thumbcaption\" style=\"padding: 0.25em 0; word-wrap: break-word;\">Peking opera performer</div></div>\n",
      "</div>\n",
      "<ul><li><a href=\"/wiki/1775\" title=\"1775\">1775</a>  <a href=\"/wiki/American_Revolutionary_War\" title=\"American Revolutionary War\">American Revolutionary War</a>: <a href=\"/wiki/Ethan_Allen\" title=\"Ethan Allen\">Ethan Allen</a> and a small force of American and Quebec militia <b><a href=\"/wiki/Battle_of_Longue-Pointe\" title=\"Battle of Longue-Pointe\">failed to capture</a></b> the city of <a href=\"/wiki/Montreal\" title=\"Montreal\">Montreal</a> from British forces.</li>\n",
      "<li><a href=\"/wiki/1790\" title=\"1790\">1790</a>  <b><a href=\"/wiki/Peking_opera\" title=\"Peking opera\">Peking opera</a></b> <i>(modern performer pictured)</i> was born with the introduction of <a href=\"/wiki/Hui_opera\" title=\"Hui opera\">Hui opera</a> to Beijing by the \"Four Great Anhui Troupes\" in honour of the <a href=\"/wiki/Qianlong_Emperor\" title=\"Qianlong Emperor\">Qianlong Emperor</a>'s 80th birthday.</li>\n",
      "<li><a href=\"/wiki/1962\" title=\"1962\">1962</a>  The <b><a href=\"/wiki/North_Yemen_Civil_War\" title=\"North Yemen Civil War\">North Yemen Civil War</a></b> began when <a href=\"/wiki/Abdullah_al-Sallal\" title=\"Abdullah al-Sallal\">Abdullah al-Sallal</a> dethroned the newly crowned <a href=\"/wiki/Muhammad_al-Badr\" title=\"Muhammad al-Badr\">Imam al-Badr</a> and declared <a href=\"/wiki/Yemen_Arab_Republic\" title=\"Yemen Arab Republic\">Yemen to be a republic</a> under his presidency.</li>\n",
      "<li><a href=\"/wiki/1977\" title=\"1977\">1977</a>  About 4,200 people took part in the first modern <b><a href=\"/wiki/Chicago_Marathon\" title=\"Chicago Marathon\">Chicago Marathon</a></b>.</li>\n",
      "<li><a href=\"/wiki/1990\" title=\"1990\">1990</a>  The <i><b><a href=\"/wiki/Ram_Rath_Yatra\" title=\"Ram Rath Yatra\">Ram Rath Yatra</a></b></i>, a politicalreligious rally organised to erect a temple to the Hindu deity <a href=\"/wiki/Rama\" title=\"Rama\">Rama</a> on the site of the <a href=\"/wiki/Babri_Masjid\" title=\"Babri Masjid\">Babri Masjid</a> in <a href=\"/wiki/Ayodhya\" title=\"Ayodhya\">Ayodhya</a>, began in the Indian state of <a href=\"/wiki/Gujarat\" title=\"Gujarat\">Gujarat</a>.</li></ul>\n",
      "<div class=\"hlist hlist-separated\" style=\"margin-top: 0.5em;\"><ul><li><b><a href=\"/wiki/Catherine_Zeta-Jones\" title=\"Catherine Zeta-Jones\">Catherine Zeta-Jones</a></b>  (<abbr title=\"born\">b.</abbr>&#160;1969)</li><li><b><a href=\"/wiki/Marian_Breland_Bailey\" title=\"Marian Breland Bailey\">Marian Breland Bailey</a></b>  (<abbr title=\"died\">d.</abbr>&#160;2001)</li><li><b><a href=\"/wiki/Jos%C3%A9_Fern%C3%A1ndez_(pitcher)\" title=\"Jos Fernndez (pitcher)\">Jos Fernndez</a></b>  (<abbr title=\"died\">d.</abbr>&#160;2016)</li></ul></div>\n",
      "<div style=\"margin-top:0.5em;\">\n",
      "More anniversaries: <div class=\"hlist hlist-separated inline nowraplinks\">\n",
      "<ul><li><a href=\"/wiki/September_24\" title=\"September 24\">September 24</a></li>\n",
      "<li><b><a href=\"/wiki/September_25\" title=\"September 25\">September 25</a></b></li>\n",
      "<li><a href=\"/wiki/September_26\" title=\"September 26\">September 26</a></li></ul>\n",
      "</div></div>\n",
