      "<div id=\"mp-lower\" class=\"MainPageBG mp-box\">\n",
      "<h2 id=\"mp-tfp-h2\" class=\"mp-h2\"><span id=\"Today.27s_featured_picture\"></span><span class=\"mw-headline\" id=\"Today's_featured_picture\">Today's featured picture</span></h2>\n",
      "<div id=\"mp-tfp\">\n",
      "<table role=\"presentation\" style=\"margin:0 3px 3px; width:100%; box-sizing:border-box; text-align:left; background-color:transparent; border-collapse:collapse;\">\n",
      "<tbody><tr>\n",
      "<td style=\"padding:0 0.9em 0 0; width:300px;\"><a href=\"/wiki/File:Annex_-_Stewart,_James_(Call_Northside_777)_01.jpg\" class=\"image\" title=\"James Stewart\"><img alt=\"James Stewart\" src=\"//upload.wikimedia.org/wikipedia/commons/thumb/e/e8/Annex_-_Stewart%2C_James_%28Call_Northside_777%29_01.jpg/300px-Annex_-_Stewart%2C_James_%28Call_Northside_777%29_01.jpg\" decoding=\"async\" width=\"300\" height=\"379\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/e/e8/Annex_-_Stewart%2C_James_%28Call_Northside_777%29_01.jpg/450px-Annex_-_Stewart%2C_James_%28Call_Northside_777%29_01.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/e/e8/Annex_-_Stewart%2C_James_%28Call_Northside_777%29_01.jpg/600px-Annex_-_Stewart%2C_James_%28Call_Northside_777%29_01.jpg 2x\" data-file-width=\"1682\" data-file-height=\"2125\" /></a>\n",
      "</td>\n",
      "<td style=\"padding:0 6px 0 0\">\n",
      "<p><b><a href=\"/wiki/James_Stewart\" title=\"James Stewart\">James Stewart</a></b> (19081997) was an American actor and military pilot. Known for his distinctive <a href=\"/wiki/Drawl\" title=\"Drawl\">drawl</a> and everyman screen persona, Stewart's film career spanned eighty films from 1935 to 1991. With the strong morality he portrayed both on and off screen, he epitomized the \"American ideal\" in the mid20th century. This publicity photograph of Stewart was taken for the 1948 film <i><a href=\"/wiki/Call_Northside_777\" title=\"Call Northside 777\">Call Northside 777</a></i>.\n",
      "</p>\n",
      "<p style=\"text-align:left;\"><small>Photograph credit: <a href=\"/wiki/20th_Century_Studios\" title=\"20th Century Studios\">20th Century Fox</a>; cropped by <a href=\"/wiki/User:Lemonreader\" title=\"User:Lemonreader\">Lemonreader</a></small></p>\n",
      "<div class=\"potd-recent\" style=\"text-align:right;\">\n",
      "Recently featured: <div class=\"hlist hlist-separated inline\">\n",
      "<ul><li><a href=\"/wiki/Template:POTD/2022-09-24\" title=\"Template:POTD/2022-09-24\">Brown-headed honeyeater</a></li>\n",
      "<li><a href=\"/wiki/Template:POTD/2022-09-23\" title=\"Template:POTD/2022-09-23\">Lichfield Cathedral</a></li>\n",
      "<li><a href=\"/wiki/Template:POTD/2022-09-22\" title=\"Template:POTD/2022-09-22\">Onsime Reclus</a></li></ul>\n",
      "</div></div>\n",
      "<div class=\"hlist hlist-separated potd-footer noprint\" style=\"text-align:right;\">\n",
