      "           <a href=\"/wiki/Red_warbler\" title=\"Red warbler\">\n",
      "            red warbler\n",
      "           </a>\n",
      "          </b>\n",
      "          (\n",
      "          <i>\n",
      "           Cardellina rubra\n",
      "          </i>\n",
      "          ) is a small bird of the\n",
      "          <a href=\"/wiki/New_World_warbler\" title=\"New World warbler\">\n",
      "           New World warbler\n",
      "          </a>\n",
      "          family, Parulidae.\n",
      "          <a href=\"/wiki/Endemism\" title=\"Endemism\">\n",
      "           Endemic\n",
      "          </a>\n",
      "          to the highlands of Mexico north of the\n",
      "          <a href=\"/wiki/Isthmus_of_Tehuantepec\" title=\"Isthmus of Tehuantepec\">\n",
      "           Isthmus of Tehuantepec\n",
      "          </a>\n",
      "          , it is closely related to the\n",
      "          <a href=\"/wiki/Pink-headed_warbler\" title=\"Pink-headed warbler\">\n",
      "           pink-headed warbler\n",
      "          </a>\n",
      "          of southern Mexico and Guatemala. There are three\n",
      "          <a href=\"/wiki/Subspecies\" title=\"Subspecies\">\n",
      "           subspecies\n",
      "          </a>\n",
      "          , which differ primarily in the shading of their ear patch and in the brightness and tone of their red body plumage. Young birds are pinkish-brown, with a whitish ear patch and two pale wingbars. Breeding typically occurs between February and May. The female lays three or four eggs in a domed nest, which she builds on the ground. Though she alone\n",
      "          <a href=\"/wiki/Egg_incubation\" title=\"Egg incubation\">\n",
      "           incubates\n",
      "          </a>\n",
      "          the eggs, both sexes feed the young and remove\n",
      "          <a href=\"/wiki/Fecal_sac\" title=\"Fecal sac\">\n",
      "           fecal sacs\n",
      "          </a>\n",
      "          from the nest. The young\n",
      "          <a href=\"/wiki/Fledge\" title=\"Fledge\">\n",
      "           fledge\n",
      "          </a>\n",
      "          within eleven days of hatching. The red warbler is an\n",
      "          <a href=\"/wiki/Insectivore\" title=\"Insectivore\">\n",
      "           insectivore\n",
      "          </a>\n",
      "          ,\n",
      "          <a href=\"/wiki/Gleaning_(birds)\" title=\"Gleaning (birds)\">\n",
      "           gleaning\n",
      "          </a>\n",
      "          primarily in\n",
      "          <a href=\"/wiki/Understory\" title=\"Understory\">\n",
      "           understory\n",
      "          </a>\n",
      "          shrubs. The species is not\n",
      "          <a href=\"/wiki/Threatened_species\" title=\"Threatened species\">\n",
      "           threatened\n",
      "          </a>\n",
      "          , but its numbers are thought to be declining due to\n",
      "          <a href=\"/wiki/Habitat_destruction\" title=\"Habitat destruction\">\n",
      "           habitat destruction\n",
      "          </a>\n",
      "          . (\n",
      "          <b>\n",
      "           <a href=\"/wiki/Red_warbler\" title=\"Red warbler\">\n",
      "            Fullarticle...\n",
      "           </a>\n",
      "          </b>\n",
      "          )\n",
