      "              drawl\n",
      "             </a>\n",
      "             and everyman screen persona, Stewart's film career spanned eighty films from 1935 to 1991. With the strong morality he portrayed both on and off screen, he epitomized the \"American ideal\" in the mid20th century. This publicity photograph of Stewart was taken for the 1948 film\n",
