      "\t        }\n",
      "\t        if(time == 0) {\n",
      "\t        \tclearInterval(interval);\n",
      "\t        \t$('#countdown_data').addClass('hide');\n",
      "\t        \t$('#resend-otp').removeClass('hide');\n",
      "\t            return;\n",
      "\t        }\n",
      "\t        var minutes = Math.floor( time / 60 );\n",
      "\t        if (minutes < 10) minutes = \"0\" + minutes;\n",
      "\t        var seconds = time % 60;\n",
      "\t        if (seconds < 10) seconds = \"0\" + seconds;\n",
      "\t        var text = minutes + ':' + seconds;\n",
      "\t        el.html(text);\n",
      "\t        time--;\n",
      "\t    }, 1000);\n",
      "\t}\n",
